import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 16.1-69.46 How salaries payable.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-69.46.md","filePath":"vacode/16.1-69.46.md"}'),i={name:"vacode/16.1-69.46.md"},l=r('<h1 id="§-16-1-69-46-how-salaries-payable" tabindex="-1">§ 16.1-69.46 How salaries payable. <a class="header-anchor" href="#§-16-1-69-46-how-salaries-payable" aria-label="Permalink to &quot;§ 16.1-69.46 How salaries payable.&quot;">​</a></h1><p>All salaries determined according to the provisions of §§ <a href="/vacode/16.1-69.44/">16.1-69.44</a> and <a href="/vacode/16.1-69.45/">16.1-69.45</a> and any salary payment required by § <a href="/vacode/16.1-69.37/">16.1-69.37</a> shall be payable by the Commonwealth, except any supplements paid to district court employees. All annual salaries shall be paid in semimonthly installments within the limits fixed by the Committee.</p><p>1972, c. 708; 1973, c. 546; 2008, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0349" target="_blank" rel="noreferrer">349</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0804" target="_blank" rel="noreferrer">804</a>; 2018, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0164" target="_blank" rel="noreferrer">164</a>.</p>',3),o=[l];function s(n,c,p,_,d,h){return a(),t("div",null,o)}const b=e(i,[["render",s]]);export{m as __pageData,b as default};
